import React from 'react'
import "./post.css"
import hunger from "../Images/hunger.jpg"

export default function Post() {
    return (
        <div>
            <img src={hunger} alt="" srcset="" className="postImg" />
            <div className="postInfo"></div>
        </div>
    )
}
